pragma solidity ^0.8.0;

//Need to import ERC20 interface to interact with external contracts;
import "../node_modules/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

//Let's do some OpenZeppelin stuff, such as Ownable
contract Wallet is Ownable {
  using SafeMath for uint256;

  struct Token {
    bytes32 ticker;
    address tokenAddress; //Need address to run transfer calls from token contracts
  }

  mapping(bytes32 => Token) public tokenMapping; //Each ticker points to a Token object
  bytes32[] public tokenList; //For tickers, we can loop through all Token objects now

  mapping(address => mapping(bytes32 => uint256)) public balances;

  modifier tokenExists(bytes32 ticker){
    require(tokenMapping[ticker].tokenAddress != address(0), "Token does not exist");
    _;
  }

  function addToken(bytes32 ticker, address tokenAddress) external onlyOwner {
    tokenMapping[ticker] = Token(ticker,tokenAddress);
    tokenList.push(ticker);
  }

  function deposit(uint amount, bytes32 ticker) external tokenExists(ticker) {
    balances[msg.sender][ticker] = balances[msg.sender][ticker].add(amount);
    IERC20(tokenMapping[ticker].tokenAddress).transferFrom(msg.sender, address(this), amount);
  }

  function withdraw (uint amount, bytes32 ticker) external tokenExists(ticker) {
    require(balances[msg.sender][ticker] >= amount, "Balance not sufficient");

    balances[msg.sender][ticker] = balances[msg.sender][ticker].sub(amount);
    IERC20(tokenMapping[ticker].tokenAddress).transfer(msg.sender, amount);
  }

  function getBalance(bytes32 _ticker) public view returns(uint) {
    return balances[msg.sender][_ticker];
  }

}
